let Distance_to_player=1.5 // How far the object is relative to the player (negative will be behind)
let up_down_constant= -0  // Positive object will go higher, negative will go lower. eg: -0.65 places the object where your hands are, approximately. 0 will place the object right above your eyes.
let refresh_rate = 200       // Number of milliseconds. Please avoid a refresh rate < 30 as it could crash the grid.


  function setPosition(object,e){ // refreshes the positions
    if (!dragging) {
        return;
    }
    let coordinate = getNextCoordinates(e.player);
    object.position.y = coordinate;
    currentPositionText = getTextPosition(coordinate);
    currentPositionText = bodyString.length * currentPositionText / 100;
    if(!object.position || !object.rotation){
        parcel.removeFeature(object)
    }else{
        setTimeout(()=>{
        setPosition(object,e)
    },refresh_rate)
  }
}
setInterval(() => {
    if (dragging) {
        if (lastPositionText != currentPositionText) {
            lastPositionText = currentPositionText;
            for (let i = 0; i < bodyText.length; i++) {

                let currentText = bodyString[i + Math.floor(currentPositionText)]
                if (currentText == undefined) {
                    currentText = "";
                }
                bodyText[i].set({'text': currentText})
            }
        }
    }
}, 600)
function getNextCoordinates(player){ 
    let playerRotation = player.rotation;
    let returnValue = 0;
    let yDelta = Distance_to_player*Math.tan(playerRotation.x);

    returnValue = player.position.y - yDelta +(up_down_constant)
    if (returnValue > sliderBarMaxY) {
        returnValue = sliderBarMaxY;
    }

    if (returnValue < sliderBarMinY) {
        returnValue = sliderBarMinY;
    }

    return returnValue;
}

function getTextPosition(coordinate) {
    maxDistance = sliderBarMaxY - sliderBarMinY;
    let percentage = (sliderBarMaxY - coordinate) * 100 / (maxDistance);

    return percentage;
}

